description:
In Chinese culture, as with other cultures, it has been martial custom for the bride's family to offer a dowry. 
A bride's dowry is mainly interior ornaments or daily necessities. Of course, wealthy parents always had the option of throwing in some real estate or couple of servant girls...
   
Items commonly found in a dowry:
-jewelry
-1 pair of chopsticks to indicate "fast son";  
-2 bowls tied up with red string which is called "sons and grandsons bowls";  
-toilet kettle;   
-bed spread and pillows and quilt embroidered with dragon-phoenix design;   
-scissors and ruler; wallet and belt,  
-sliced candy;  
-tea sets including tea pot, tea cups and tea tray;  
-clothe wrapped together with cypress leaves,  
-lotus seeds,  
-lucky money (Li Shi),  
-dried fruit such as dragon eyes

I created this double bracelet as a symbol of double happiness held together with a lotus bloom which stands for purity.  I used a padparadscha in the center of the lotus and while tiny pink coral and peridot beads dangle from the bracelets.

Each bangle is 2 1\/2" in diameter.
